import { useEffect } from "react";
import UseEmployerContext from "../../hooks/UseEmployerContext";
import "./EmployerProfile.css"
import Navbar from "../../components/Navbar";

const EmployerProfile = () => {
  const { employers, dispatch } = UseEmployerContext();
  const idEmployer = "66cb27361832cdc4bc0cef66";

  useEffect(() => {
    const fetchEmployer = async () => {
      const response = await fetch(
        `/API/Employer/single-employer/${idEmployer}`
      );
      const data = await response.json();
      console.log('data', data)

      if (response.ok) {
        dispatch({ type: "SET_EMPLOYER", payload: data });
      }
    };
    fetchEmployer();
  }, [dispatch]);


  return (
    <div className="employer-profile">
      {/* Profile Header */}
      <Navbar />
  
      <div className="profile-header">
        <img
          src={"https://randomuser.me/api/portraits/men/52.jpg"}
          alt="Profile"
          className="profile-logo"
        />
        <div className="profile-info">
          <h1 className="employer-name">{employers?.name}</h1>
          <p className="employer-company">{employers?.companyName}</p>
        </div>
      </div>
  
      {/* About Me Section */}
      <div className="profile-about">
        <h2>About Me</h2>
        <p>
          Hi, I'm the founder of {employers?.companyName}, with a passion for innovation and excellence in the industry. With extensive experience and a strong vision, I have led the company to new heights.
        </p>
      </div>
  
      {/* Company Overview */}
      <div className="profile-company-overview">
        <h2>Company Overview</h2>
        <p>
          {employers?.companyName} is a leading firm specializing in [Industry], dedicated to delivering top-notch solutions and services to clients worldwide. Our mission is to innovate and provide the highest quality products that meet the evolving needs of our customers.
        </p>
      </div>
  
      {/* Competences Section */}
      <div className="profile-competences">
        <h2>Competences</h2>
        <ul>
          <li>Strategic Leadership</li>
          <li>Innovative Problem Solving</li>
          <li>Project Management</li>
          <li>Industry Expertise</li>
          {/* Add more competences as needed */}
        </ul>
      </div>
  
      {/* Experience Section */}
      <div className="profile-experience">
        <h2>Experience</h2>
        <div className="experience-item">
          <h3>Role at {employers?.companyName}</h3>
          <p>Brief description of responsibilities and achievements.</p>
        </div>
        {/* Add more experience items as needed */}
      </div>
  
      {/* Education Section */}
      <div className="profile-education">
        <h2>Education</h2>
        <div className="education-item">
          <h3>Degree in Field of Study</h3>
          <p>Institution Name</p>
          <p>Years Attended</p>
        </div>
        {/* Add more education items as needed */}
      </div>
  
      {/* Contact Information */}
      <div className="profile-contact-info">
        <h2>Contact Information</h2>
        <p>Email: {employers?.email}</p>
        {/* Add other contact details if needed */}
      </div>
    </div>
  );
  

};

export default EmployerProfile;
